void MOD_mkTestBench::dump_VCD(tVCDDumpType dt, unsigned int levels, MOD_mkTestBench &backing)
{
  vcd_defs(dt, backing);
  vcd_prims(dt, backing);
}

void MOD_mkTestBench::vcd_defs(tVCDDumpType dt, MOD_mkTestBench &backing)
{
  unsigned int num = vcd_num;
  if (dt == VCD_DUMP_XS)
  {
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 32u);
    vcd_write_x(sim_hdl, num++, 16u);
    vcd_write_x(sim_hdl, num++, 16u);
  }
  else
    if (dt == VCD_DUMP_CHANGES)
    {
      if ((backing.PORT_RST_N) != PORT_RST_N)
      {
	vcd_write_val(sim_hdl, num, PORT_RST_N, 1u);
	backing.PORT_RST_N = PORT_RST_N;
      }
      ++num;
      if ((backing.DEF_b__h23556) != DEF_b__h23556)
      {
	vcd_write_val(sim_hdl, num, DEF_b__h23556, 32u);
	backing.DEF_b__h23556 = DEF_b__h23556;
      }
      ++num;
      if ((backing.DEF_d__h34666) != DEF_d__h34666)
      {
	vcd_write_val(sim_hdl, num, DEF_d__h34666, 16u);
	backing.DEF_d__h34666 = DEF_d__h34666;
      }
      ++num;
      if ((backing.DEF_x__h29219) != DEF_x__h29219)
      {
	vcd_write_val(sim_hdl, num, DEF_x__h29219, 16u);
	backing.DEF_x__h29219 = DEF_x__h29219;
      }
      ++num;
    }
    else
    {
      vcd_write_val(sim_hdl, num++, PORT_RST_N, 1u);
      backing.PORT_RST_N = PORT_RST_N;
      vcd_write_val(sim_hdl, num++, DEF_b__h23556, 32u);
      backing.DEF_b__h23556 = DEF_b__h23556;
      vcd_write_val(sim_hdl, num++, DEF_d__h34666, 16u);
      backing.DEF_d__h34666 = DEF_d__h34666;
      vcd_write_val(sim_hdl, num++, DEF_x__h29219, 16u);
      backing.DEF_x__h29219 = DEF_x__h29219;
    }
}

